23/Sep/24 9:57 AM;60957172a56f2f006f65f1e9;{noformat}// ValidateRelayStates validates the positions of the main and branch relays on
// the SDS by ensuring it aligns with the relay state diagram and truth table.
func ValidateRelayStates(config *plugin.Config) (*RelayStates, error) {
	logger := config.Logger()
	logger.Info("validating_the_position_of_the_main_and_branch_relays")

	relaySignals := []string{
		MainRelayStateSignal,
		PvRelayStateSignal,
		GenRelayStateSignal,
	}

	var (
		relayData map[string]float64
		err       error
	)

	if relayData, err = InfluxReadFloat(config, relaySignals); err != nil {
		return nil, fmt.Errorf("failed_to_read_signal")
	}
	mainRelayState := relayData[MainRelayStateSignal]
	genRelayState := relayData[GenRelayStateSignal]
	pvRelayState := relayData[PvRelayStateSignal]

	logger.Info("main_relay_state", zap.String("signal", MainRelayStateSignal),
		zap.Float64("relay_state", mainRelayState))
	logger.Info("gen_relay_state", zap.String("signal", GenRelayStateSignal),
		zap.Float64("relay_state", genRelayState))
	logger.Info("pv_relay_state", zap.String("signal", PvRelayStateSignal),
		zap.Float64("relay_state", pvRelayState))

	validRelayStateCondition := false

	switch {
	case mainRelayState == RelayClosedValue:
		validRelayStateCondition = genRelayState != RelayClosedValue

	case genRelayState == RelayClosedValue:
		validRelayStateCondition = (mainRelayState != RelayClosedValue) && (pvRelayState != genRelayState)

	case pvRelayState == RelayClosedValue:
		validRelayStateCondition = pvRelayState != genRelayState

	default:
		validRelayStateCondition = (mainRelayState != genRelayState) && (pvRelayState != genRelayState)
	}

	if validRelayStateCondition {
		logger.Info("relay_state_combinations_supported_in_relay_state_truth_table")
	} else {
		logger.Error("relay_state_combinations_not_supported_in_relay_state_truth_table")
		return nil, fmt.Errorf("relay_state_combinations_not_supported_in_relay_state_truth_table")
	}

	relayStates := &RelayStates{
		MainRelayState: mainRelayState,
		GenRelayState:  genRelayState,
		PvRelayState:   pvRelayState,
	}

	return relayStates, nil
}
